import React from 'react';
import './styles.css';

const Header = () => {
  return (
    <div class="header">
      <h2>Tannor Johnson</h2>
      <div class="category-options">
        <ul>
          <a href="#about">About</a>
        </ul>
        <ul>
          <a href="#experience">Experience</a>
        </ul>
        <ul>
          <a href="#coursework">Coursework</a>
        </ul>
      </div>
    </div>
  );
};

export default Header;
